import React, { Component } from 'react';

export default class Account extends Component{

    constructor(login){
        super(login);
        this.state = {
            dat: []
          }
    }

    #getAccount = async () => {
        try {
            const response = await fetch("http://localhost:4000/search/8");
            const jsonData = await response.json();
            
            this.state({dat: jsonData.account_name})

        } catch (error) {
            console.error(error);
        }
    };


    render = async () => {
        this.#getAccount();
        const { goods } = this.state
        console.log(goods);
        return<div>hi</div>;
    }
}
